    <>
    <h3>Comments:</h3>
    {comments.map(comment => (
    <div className="comment" key={comment.postedBy.name + ': ' + comment.text}>
        <h4>{comment.postedBy.name}</h4>
        <p>{comment.text}</p>
    </div>
))}

    
    </>
);

export default CommentsList;
